import React from 'react'

function Idiomas() {
  return (
    <div className='idiomas'>
        <div className='bandera'><img src="/imagenes/spain.jpeg" alt="" /></div>
        <div className='bandera'><img src="../image/uk.png" alt="" /></div>
        <div className='bandera'><img src="../image/francia.png" alt="" /></div>
    </div>
  )
}

export default Idiomas
